35	JFC-Linna	6	2011-01-18 18:32:52.169792	2012-07-08 04:55:05.182681	jfc-linna	f	---\n- ''\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000393\n	Healthy young adults; native speakers of Mandarin Chinese and subsequently learned English. All had been in Canada from between 1 to 12 years. All were right handed. Average age = 20.6, s.d. = 1.9 yrs.	Four conditions manipulating either sentence body or sentence terminal word language. Sentences were either English/English (EE), English/Mandarin (EC), Mandarin/English (CE) or Mandarin/Mandarin (CC) with respect to the sentence body and terminal word.	ERPs were preprocessed in BrainVision Analyzer (2.0.2) with the following procedure.\r\n- Channels were renamed to 10-20 (from BioSemi ABC) and rereferenced to averaged mastoids\r\n- Filters were applied with the following parameters:\r\nButterworth Zero Phase Filters\r\nLow Cutoff: 0.1 Hz, Time constant 1.591549, 24 dB/oct\r\nHigh Cutoff: 30 Hz, 24 dB/oct\r\nNotch Filter: 60 Hz\r\n- Data was visually inspected to exclude pauses in stimulus presentation and large head movements or other uncorrectable artefacts\r\n- Ocular ICA correction was done, with the two factors individually corresponding to the maximal VEOG and HEOG being removed. Quality of factor isolation and correction was visually inspected.\r\n- Continuous data was segmented, locally DC detrended and baseline corrected\r\n- Individual averages were computed for each participant and exported for use in NEMO, using the "Generic Data Export" function	64-channel ERPs were recorded as subjects performed a silent reading task of semantically congruent, high cloze English/Mandarin or combination sentences. Sentences were presented in two parts: the main body of the sentence, and the terminal word. Sentences were either English/English, English/Mandarin, Mandarin/English or Mandarin/Mandarin with respect to the sentence body and terminal word. Target ISI was 250 ms from end of presentation of sentence body.	2010	2010	Subjects were instructed to arrive with cleaned hair and without hair products or cosmetics. Headcaps were placed on the subject, electrode plugs filled with electroconductive gel while parting the hair with a plastic tipped syringe.\r\nContinuous EEG was collected for the duration of stimulus presentation, including small self-paced breaks.	Subgroup 1 subject averages:\r\nTotal of 204 individual files, corresponding to 4 conditions x 17 subjects. Each average consists of three files: data header (*.vhdr), binary data (*.dat), and marker data (*.vmkr).\r\nSubjects are represented by P##, where ## is their identification number. Conditions are S1, S2, S4, and S8, corresponding to ##, ##, ## and ## conditions, respectively.
3	DLM-N400	2	2010-11-02 08:03:22.401677	2011-09-26 20:06:38.671145	dlm-n400	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000393\n	21 adults (females 10,) between the ages of 30 and 45 (M = 35.47, SD =3.97) who held either a medical or doctorate degree participated in this study.  Participants were recruited through on-campus advertisements, letters to departments, and mass distribution email at a large southeast university, as well as surrounding universities and facilities.  All participants were consented according to the University of Louisville’s Institutional Review Board procedures and all confidentiality was maintained according to those guidelines. 	 Participants viewed twenty-eight six-word sentence pairs on a 17” computer monitor centered 36” directly in front of them.  Letters were white on black background, upper and lower case, in Courier New 18 point font.  Sentences were declarative in structure with typical subject-predicate organization.  The final word of the sentence was either semantically congruent or incongruent with the sentence proposition (Frishkoff & Tucker, 2001). \r\n\r\nCongruent-incongruent pairs rhymed.  Words in the sentence were presented one at a time.  All stimuli (fixation and words) were presented for one second with one-second inter-stimulus intervals.  The exception was the final word, presented for 2500 ms. Responses were recorded to frequent and target tones by pressing corresponding buttons on a 4-button response pad.  Buttons 1 and 4 were used for the final word, indicating congruence or incongruence, and were counterbalanced across participants, gender, and testing session.  	ERPs were recorded using either a 256-channel electrode array, with vertex recording reference. Before data processing, a low-pass filter of 30Hz and high-pass filter of 0.3Hz applied offline. Trials were segmented into 1000ms epochs onset of stimulus with baseline 200ms. \r\n\r\nBad channels found during manual inspection and during artifact detection approach were replaced automatically. Artifact  detection includes marking bad channels, eye blink and eye movements if amplitude of the signal  > 150 . Channels were marked bad in recording if it contains more than 30%.  Segmented considered as bad if contains, eye blinks, eye movement and more than 20 bad channels.  \r\n \r\nThe cleaned data were averaged and re-referenced to the average of the recording sites by excluding bad channels from reference and were baseline corrected 200 ms prior to the stimulus. 	256-Electrode ERP were collected as subjects performed an N400 task. Sentences were declarative in structure with typical subject-predicate organization. The final word of the sentence was either symantically congruent or incongruent with the sentence proposition. Congruent-Incongruent pairs rhymed. Words in the sentences were presented one at a time. All stimuli (fixation and words) are presented for 1000ms  with 1000ms inter-stimulus intervals. The exception was the final word, presented for 2500ms.	2006	2009	Participants wore a 256-high density array hydrocel electrode geodesic net (EGI, Eugene, OR).  The electrodes were made of Ag/AgCl and were arranged according to the International 10-20 System (Jasper, 1958).  Electrodes were initially referenced to Cz.  Data were collected using a bandpass filter of .1 to 100 Hz.  Data were collected with a sampling rate of 250 Hz (one sample/4 ms).  The net was soaked in a warm saline solution for approximately ten minutes prior to application to ensure the proper hydration of all electrodes and the comfort of the participant.  Impedances were measured and reduced to less than 40 KΩ by applying additional electrolyte solution through a pipette to hydrate marked electrodes.  Before the task was started, impedances were reduced so that no more than five non-adjacent electrodes exceeded the 40 KΩ threshold.  Both Cz and Fz electrodes always fell below the recommended threshold for this experiment.  \r\n	Subject averages (n=21) in Netstation simple binary format. 
38	TC-RGLD	4	2011-02-08 19:58:16.278656	2012-06-28 21:31:31.634366	tc-rgld	f	---\n- ''\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_8267000\n	Subjects were undergraduates participating to satisfy a research requirement in introductory psychology at Case Western Reserve University. All subjects were right-handed and native English speakers. A total of 54 subjects participated. After rejecting the data of subjects with less than 16 acceptable trials in any condition, 32 subjects were included in the analysis.	LN0 - Lexical decision, Nonword, New\r\nLN1 - Lexical decision, Nonword, Old\r\nLW0 - Lexical decision, Word, New\r\nLW1 - Lexical decision, Word, Old\r\nRN0 - Recognition, Nonword, New\r\nRN1 - Recognition, Nonword, Old\r\nRW0 - Recognition, Word, New\r\nRW1 - Recognition, Word, Old 	Trials were dropped from analyses if they contained eye movements (vertical EOG channel difference greater than 70μV) or more than five bad channels. Channels were considered bad for an individual trial if they changed more than 100 μV between adjacent samples, or\r\nreached amplitudes over 200 μV. Individual channels that were consistently bad for a given subject were excluded from all analyses for that subject. Most subjects had no excluded channels (26 of 32) and the highest number of excluded channels was three (1 subject). All\r\nanalyses were performed on across-channel means, so each subject's bad channels were excluded from the computation of these means. ERPs were baseline-corrected with respect to a 428 ms pre-stimulus interval and digitally low-pass filtered at 55 Hz.\r\n\r\nRather than only including correct trials in the ERPs, all artifact-free trials were used. Considering only correct trials would have biased the comparison of lexical decision (LD) and recognition (RG) tasks because accuracy is based on different discriminations in each task. For\r\nexample, using only accurate trials could produce differences between RG and LD old/new effects merely because the RG old/new effect is based on accurately recognized words but the LD old/new effect would include potentially unrecognized words. Subjects rarely responded prior to stimulus offset, so these infrequent trials were not excluded from analyses.	Event-related brain potentials (ERPs), recorded from a 128-sensor array were used to differentiate brain processes associated with intentional vs incidental memory retrieval. Two experiments examined ERP differences between old (studied) and new (non-studied) words and pseudowords while subjects performed either a recognition memory task or lexical decision task. Previous research has related a P600 old/new effect to the recollection of details, and the present experiments show that this effect was not amplified by intentional retrieval. The P600 effect was larger for words and pseudowords. A third, previously unidentified, mid-frontal, old/new effect was associated with only pseudoword recognition from 300 to 500 ms. Results are discussed with respect to dual-process theories of recognition memory.	1996	1996	Scalp voltages were collected with a 128-channel Geodesic Sensor Net connected to a custom-built, AC-coupled, 128-channel, high input impedance amplifier (200kΩ, Net Amps, Electrical Geodesics Inc., Eugene, OR, U.S.A.). Amplified analog voltages (0.1-100 Hz bandpass) were digitized at 250 Hz. Individual sensors were adjusted until each reached an impedance of less than 50 kΩ.	RGLD input file\r\n\r\nDecomposition Results\r\n  Temporal PCA\r\n  Rotated Factors = 50\r\n  Exported Factors = 15\r\n\r\nMetric Extraction results\r\n  Each Condition Separately\r\n  Difference Wave LN0-LW0\r\n  Difference Wave RN0-RW0\r\n
42	TC-MET	4	2011-02-12 19:52:51.950481	2012-03-15 16:08:23.46499	tc-met	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0563000\n	Twenty-nine right-handed native English speakers (19 men, 10 women, average age 19.7) in the University of Colorado in Boulder participated in this experiment for course credit. None had any neurological disorder or major head injury that was diagnosed as having a long-term side effect. Data were discarded from 5 subjects who had less than 15 acceptable trials per condition per block due to blinking.	Sentences ending with a word that is a:\r\n- Literal ending (sentence is literally meaningful)\r\n- Conventional metaphor (sentence is familiar and interpretable)\r\n- Novel metaphor (sentence is a novel metaphor)\r\n- anomalous ending (sentence is semantically anomalous)	The EEG was digitally low-pass filtered at 40 Hz. Trials were discarded from analyses if more than 20% of channels were bad (average amplitude over 100 μV or transit amplitude over 50 μV). Eye movements were corrected with an ocular artifact correction algorithm (Gratton, Coles, and Donchin, 1983). Individual bad channels were replaced on a trial-by-trial basis with a spherical spline algorithm (Srinivasan et al., 1996). EEG was measured with respect to a vertex reference (Cz), but transformed to an average mastoids reference for analysis. Event-related potentials (ERP) were obtained by stimulus-locked averaging of the EEG recorded in each condition. ERPs were baseline-corrected with respect to a 200 ms pre-stimulus recording interval.\r\n\r\n	Abstract\r\nThe neural mechanisms underlying the processing of conventional and novel conceptual metaphorical sentences were examined with event-related potentials (ERPs). Conventional metaphors were created based on the Contemporary Theory of Metaphor and were operationally defined as familiar and readily interpretable. Novel metaphors were unfamiliar and harder to interpret. Using a sensicality judgment task, we compared ERPs elicited by the same target word when it was used to end anomalous, novel metaphorical, conventional metaphorical and literal sentences. Amplitudes of the N400 ERP component (320–440 ms) were more negative for anomalous sentences, novel metaphors, and conventional metaphors compared with literal sentences. Within a later window (440– 560 ms), ERPs associated with conventional metaphors converged to the same level as literal sentences while the novel metaphors stayed anomalous throughout. The reported results were compatible with models assuming an initial stage for metaphor mappings from one concept to another and that these mappings are cognitively taxing.	2006	2007	Scalp voltages were collected with a 128-channel HydroCel Geodesic Sensor Net™ connected to an AC coupled, 128-channel, high-input impedance amplifier (200 MΩ, Net AmpsTM, Electrical Geodesics Inc., Eugene, OR). Amplified analog voltages (0.1–100 Hz bandpass) were digitized at 250 Hz. Individual sensors were adjusted until impedances were less than 40 kΩ. 	MET input file\r\n\r\nDecomposition Results\r\n  Temporal PCA\r\n  Rotated Factors = 50\r\n  Exported Factors = 15\r\n\r\nMetric Extraction results\r\n  Each Condition Separately\r\n  Difference Wave Anomalous - Literal\r\n  Difference Wave Conventional - Literal\r\n  Difference Wave Novel - Literal
