36	GAF-LP1	3	2011-01-25 23:11:09.187961	2012-06-24 05:27:27.266269	gaf-lp1	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000390\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000392\n	Fifty participants were recruited from introductory courses in Psychology at the University of Oregon. Subjects were native English speakers who were right-handed, with normal or corrected-to-normal vision. Academic course credit was given in exchange for participation. Five subjects had two few good EEG trials after artifact rejection; three additional subjects had excessive alpha or frontal EMG. This left 42 subjects (20 male; mean age = 19.7, SD = 3.1; 24 with at least one left-handed relative) who generated sufficient quality EEG data for further analysis.	There are four experimental conditions and one filler condition in this experiment. The four experimental conditions are 'WC' (closely related prime-target word pairs), 'WR' (remotely related word pairs), 'WU' (unrelated word pairs), 'XW' (real-word targets, preceded by a neutral prime), and 'XN' (pseudoword targets, preceded by a neutral prime). The filler category ('WN') consisted of a real-word prime, followed by a pseudoword target. \r\n\r\nThe experiment consisted of eight blocks of 100 trials each. A trial began with the presentation of a rectangular outline, which cued the subject to initiate the experimental sequence when ready by pressing both the right and left buttons simultaneously using their right and left index fingers. Once the subject initiated a trial, a central fixation (‘‘+’’ symbol) appeared for 500 ms. Next, a word (the prime) was presented foveally, followed after a short interval (ISI) by a second word (the target). The stimulus-onset asynchrony (SOA) was 800ms (prime duration 600 ms, ISI 200 ms). \r\n\r\nThe subject’s task was to respond ‘‘as quickly and as accurately as possible’’ whether the tar- get stimulus was a real English word or not. ‘‘Yes’’ and ‘‘no’’ (right versus left) keys were counterbalanced across subjects. 	Trials were edited offline for eye blinks and head movements. The remaining trials were segmented into 2500ms epochs, starting 1000 ms before onset of the target word. Segmented data were averaged across trials (within subjects and within condition) and digitally filtered with a 30-Hz lowpass filter.\r\n\r\nChannels were automatically marked bad for a given trial if blinks or eye movements were detected, if amplitudes >150 lV, if differential average amplitude (i.e., changes in slope) >75 lV, if the channel was flat (had zero variance), or if manual inspection suggested noise specific to that channel (i.e., not affecting surrounding channels). Any channel marked bad for more than 20% of the total trials was interpolated based on data measured at near-by electrodes. Subjects with more than 10 bad channels or with fewer than 15 clean EEG trials in any one of the experimental conditions were excluded from further analysis (five subjects met these criteria and were excluded).\r\n\r\nThe cleaned data were re-referenced to the average of the recording sites and were baseline corrected 200 ms prior the target word.\r\n	128-channel ERPs were recorded as subjects performed a lexical decision task. Word trials were equally divided into strongly related, weakly related, and unrelated word pairs. All words were foveally presented. SOA was 800ms (prime duration = 600ms; prime-target ISI = 200ms).	2003	2005	ERPs were recorded using either a 128-channel electrode array, with vertex recording reference. Data were sampled at a rate of 250 per second and were amplified with a .01-Hz highpass filter (time constant, 10 s). 	The following files have been uploaded for this experiment: (1) input ERP data file (.raw file); (2) tPCA output data file (.raw file); tPCA Pattern Extraction script (.m file); (2) Metric Extraction/RDF generation script (.m file); (3) Metric Extraction/RDF output (.rdf file); (4) Summary of tPCA Pattern Classification Results (using NEMO v2.95). In addition, there are results for subgroup 1 (n=20), subgroup2 (n=21), and for the full sample (n=42).
57	GAF-NP	3	2012-06-21 17:14:47.073918	2012-06-25 21:03:52.068382	gaf-np	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000393\n	Seventy-eight participants were recruited from introductory courses in Psychology at the University of Oregon. Subjects were native English speakers who were right-handed, with normal or corrected-to-normal vision. Academic course credit was given in exchange for participation. After excluding participants due to excessive artifacts, equipment failure, or experimenter error, there were 53 subjects remaining (20 male; mean age = 20, SD = 5; 26 with at least one left-handed relative). The larger sample was divided into two subgroups (n=25, n=28) for a split replicate analysis.	There are four experimental conditions in this experiment: 'Con-Mid' (mid-sentence congruous targets), 'Incon-Mid' (mid-sentence incongruous targets), 'Con-Final' (sentence-final congruous targets), and 'Incon-Final' (sentence-final incongruous targets). \r\n\r\nThe experiment consisted of six blocks of 60 trials each. On each trial, a fixation point\t(‘ + ’\tsymbol)\tappeared\tfor\t500\tms,\tfollowed\tby\ta sentence, presented one word at a time. Each word was presented for 450 ms, and the inter-word interval was 150 ms. The last word in each sentence was marked with a period. Subjects were instructed to make their response as soon as the last word in a sentence disappeared from the screen; after the subject’s response, there was a 1000-ms wait before the next trial.\r\n\r\nThe subject’s task was to respond as quickly and as accurately as possible to the following question: Does the sentence make sense?’ ‘‘Yes’’ and ‘‘no’’ (right versus left) keys were counterbalanced across subjects. 	Trials were edited offline for eye blinks and head movements. The remaining trials were segmented into 1500-ms epochs, starting 500 ms before onset of the target word and terminating 1000 ms after onset. Segmented data were averaged across trials and digitally filtered with a 40-Hz lowpass filter. The data were baseline corrected, using the average of the 200-ms pre-stimulus epoch, re-referenced to the average of the 128 recording sites.	128-channel ERPs were recorded as subjects performed a semantic congruity judgment. Sentence were presented, one word at a time, and ERPs were timelocked either to sentence-medial or sentence-final words ("targets"). The target words were either semantically congruous with the preceding context or semantically incongruous. All words were foveally presented. Word duration was 450 ms. Interword interval (ISI) was 150 ms.	2000	2003	ERPs were recorded using either a 128-channel electrode array, with vertex recording reference. Data were sampled at a rate of 250 per second and were amplified with a .01-Hz highpass filter (time constant, 10 s). 	hahahaha
55	GAF-LP2	3	2012-06-20 00:48:05.806353	2012-06-24 17:03:19.412407	gaf-lp2	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000390\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000392\n	Sixty-two participants were recruited from introductory courses in Psychology at the University of Oregon. Subjects were native English speakers who were right-handed, with normal or corrected-to-normal vision. Academic course credit was given in exchange for participation. One session was aborted due to equipment failure, six datasets had too few trials after rejection of arti- facts (<20 per cell), and eight subjects had data that were otherwise noisy due to excessive alpha, EMG, or blink recovery artifacts. This left 42 subjects (20 male; mean age = 19.9, SD = 2.9; 26 with at least one left-handed relative) who generated sufficient quality EEG data for further analysis.	There are four experimental conditions and one filler condition in this experiment. The four experimental conditions are 'WC' (closely related prime-target word pairs), 'WR' (remotely related word pairs), 'WU' (unrelated word pairs), 'XW' (real-word targets, preceded by a neutral prime), and 'XN' (pseudoword targets, preceded by a neutral prime). The filler category ('WN') consisted of a real-word prime, followed by a pseudoword target. \r\n\r\nThe experiment consisted of eight blocks of 100 trials each. A trial began with the presentation of a rectangular outline, which cued the subject to initiate the experimental sequence when ready by pressing both the right and left buttons simultaneously using their right and left index fingers. Once the subject initiated a trial, a central fixation (‘‘+’’ symbol) appeared for 500 ms. Next, a word (the prime) was presented foveally, followed after a short interval (ISI) by a second word (the target). The stimulus-onset asynchrony (SOA) was 200ms (prime duration 150 ms, ISI 50 ms). \r\n\r\nThe subject’s task was to respond ‘‘as quickly and as accurately as possible’’ whether the tar- get stimulus was a real English word or not. ‘‘Yes’’ and ‘‘no’’ (right versus left) keys were counterbalanced across subjects. 	Trials were edited offline for eye blinks and head movements. The remaining trials were segmented into 1800ms epochs, starting 200 ms before onset of the target word. Segmented data were averaged across trials (within subjects and within condition) and digitally filtered with a 30-Hz lowpass filter.\r\n\r\nChannels were automatically marked bad for a given trial if blinks or eye movements were detected, if amplitudes >150 lV, if differential average amplitude (i.e., changes in slope) >75 lV, if the channel was flat (had zero variance), or if manual inspection suggested noise specific to that channel (i.e., not affecting surrounding channels). Any channel marked bad for more than 20% of the total trials was interpolated based on data measured at near-by electrodes. Subjects with more than 10 bad channels or with fewer than 15 clean EEG trials in any one of the experimental conditions were excluded from further analysis (five subjects met these criteria and were excluded).\r\n\r\nThe cleaned data were re-referenced to the average of the recording sites and were baseline corrected 200 ms prior the target word. 	128-channel ERPs were recorded as subjects performed a lexical decision task. Word trials were equally divided into strongly related, weakly related, and unrelated word pairs. All words were foveally presented. SOA was 200ms (prime duration = 150ms; prime-target ISI = 50ms).	2003	2005	ERPs were recorded using either a 128-channel electrode array, with vertex recording reference. Data were sampled at a rate of 250 per second and were amplified with a .01-Hz highpass filter (time constant, 10 s). 	The following files have been uploaded for this experiment: (1) input ERP data file (.raw file); (2) tPCA output data file (.raw file); tPCA Pattern Extraction script (.m file); (2) Metric Extraction/RDF generation script (.m file); (3) Metric Extraction/RDF output (.rdf file); (4) Summary of tPCA Pattern Classification Results (using NEMO v2.95). Summary of tPCA Pattern Classification Results (using NEMO v2.95). In addition, there are results for subgroup 1 (n=23), subgroup2 (n=24), and for the full sample (n=47).
54	JFC-shanthiya	6	2012-05-14 20:57:59.094809	2012-07-06 16:00:55.192262	jfc-shanthiya	f	---\n- http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000393\n	Fourteen (males = 5, females = 9) native English speaking undergraduate students with a mean age of 19.93 years (range =18 to 22) and normal or corrected-to-normal vision participated and each was naïve with respect to the experimental hypotheses. Subjects were assessed using the Edinburgh Handedness Inventory for handedness, all subjects were found to be dextral with a Laterality Quotient ranging from 41 to 90 as assessed using the Edinburgh Handedness Inventory (Oldfield, 1971). Subjects were screened for proficiency in the English language through the Health Questionnaire created by the Dr. Connolly’s and Dr. Service’s Memory and Brain Lab.	SCW = Semantically congruent, real word of English\r\nSIW = Semantically incongruent, real word of English\r\nSINWP = Semantically incongruent, orthographically incorrect, pronounceable word of English\r\nSINWN = Semantically incongruent, orthographically incorrect, non-pronounceable word of English	\N	Participants will read 200 sentences during the time they are connected to the EEG. The characteristics of terminal words/nonwords will be manipulated in 4 different conditions where (1) the terminal item is the correct word to end that sentence; (2) the terminal word is semantically incorrect; (3) the terminal word is a pronounceable non-word; and, (4) the terminal word is a less pronounceable non-word. It was hypothesized that if the N270 is sensitive to orthography only the presence of the peak should vary according to that characteristic but be unaffected by pronounceability.	2010	2010	\N	\N
