77898	located_in	http://purl.bioontology.org/NEMO/ontology/NEMO_deprecated.owl#NEMO_0000173	RO Definition (as of May 2009): Location as a relation between instances: The primitive instance-level relation c located_in r at t reflects the fact that each continuant is at any given time associated with exactly one spatial region, namely its exact location. Following we can use this relation to define a further instance-level location relation - not between a continuant and the region which it exactly occupies, but rather between one continuant and another. c is located in c1, in this sense, whenever the spatial region occupied by c is part_of the spatial region occupied by c1.  Note that this relation comprehends both the relation of exact location between one continuant and another which obtains when r and r1 are identical (for example, when a portion of fluid exactly fills a cavity), as well as those sorts of inexact location relations which obtain, for example, between brain and head or between ovum and uterus	2012-06-26 21:14:42.323932	2012-06-26 21:14:42.323932
77899	proper_part_of	http://purl.bioontology.org/NEMO/ontology/NEMO_deprecated.owl#NEMO_0000178	As for part_of, with the additional constraint that subject and object are distinct, OBO-REL:part_of := For continuants: C part_of C' if and only if: given any c that instantiates C at a time t, there is some c' such that c' instantiates C' at time t, and c *part_of* c' at t. For processes: P part_of P' if and only if: given any p that instantiates P at a time t, there is some p' such that p' instantiates P' at time t, and p *part_of* p' at t. (Here *part_of* is the instance-level part-relation.), [REFERENCE?? pp num??]	2012-06-26 21:14:42.326048	2012-06-26 21:14:42.326048
