77918	Goldman_equation	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_3548000	The Goldman_equation is a formula from which the steady-state membrane potential for a given set of ionic concentrations inside and outside a cell and the relative permeabilities of the membrane to each of those ions can be derived.  It is the gas constant (8.315 per Kelvin per mole) multiplied by the temperature in Kelvins over Faraday’s constant (96485 coulombs per mole).  This quantity is then multiplied by the natural log of the following: the relative permeability of Potassium ions outside the cell multiplied by the concentration of Potassium outside the cell plus the relative permeability of Sodium ions outside the cell multiplied by the concentration of Sodium outside the cell plus the relative permeability of Chloride ions inside the cell multiplied by the concentration of Chloride ions inside the cell over the relative permeability of Potassium ions inside the cell multiplied by the concentration of Potassium inside the cell plus the relative permeability of Sodium ions inside the cell multiplied by the concentration of Sodium inside the cell plus the relative permeability of Chloride ions outside the cell multiplied by the concentration of Chloride ions outside the cell.	2012-06-26 21:14:42.380251	2012-06-26 21:14:42.380251
