77990	measured_scalp_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO_deprecated.owl#NEMO_0000004	textDefinition: The measured_scalp_surface_region is a region of the scalp surface that is defined with respect to is a particular measurement apparatus (e.g., 64-channel Neuroscan EEG system, 256-channel EGI EEG system, etc.).\n---\nontoDefinition: The measured_scalp_surface_region is a scalp_surface_region that is equivalent to the union of six disjoint classes: frontopolar_scalp_surface_region, frontocentral_scalp_surface_region, parietal_scalp_surface_region, occipital_scalp_surface_region, frontotemporal_scalp_surface_region, and postero_temporal_scalp_surface_region.	2012-06-26 21:14:42.588246	2012-06-26 21:14:42.588246
