77995	scalp_ERP_activity	http://purl.bioontology.org/NEMO/ontology/NEMO_deprecated.owl#NEMO_0000522	scalp_ERP_activity is scalp_electrophysiological_activity that is time-locked to  a stimulus, response, or other event of interest (i.e. this activity occurs at a predictable latency with respect to the event). ERP activity is considered to reflect event-related changes in post-synaptic potentials of neurons in the brain that are volume-conducted to the head surface (i.e., scalp). Typically, scalp_ERP_activity is measured by averaging across EEG intervals that are time-locked to the event of interest, in order to remove "background" electrophysiological activity (ongoing oscillations in the EEG that are not time-locked to the event). Single-trial ERPs are also studied, but are harder to characterize because of their low signal-to-noise ratio  (SNR).	2012-06-26 21:14:42.600277	2012-06-26 21:14:42.600277
