78135	has_specified_input	http://purl.obolibrary.org/obo/OBI_0000293	A relation between a planned process and a continuant participating in that process that is not created during  the process. The presence of the continuant during the process is explicitly specified in the plan specification which the process realizes the concretization of.	2012-06-26 21:14:43.162065	2012-06-26 21:14:43.162065
78136	is_concretization_of	http://purl.obolibrary.org/obo/OBI_0000294	is_concretization_of is a relationship between a generically dependent continuant and a specifically dependent continuant. A generically dependent continuant may inhere in more than one entity. It does so by virtue of the fact that there is, for each entity that it inheres, a specifically dependent *concretization* of the generically dependent continuant that is specifically dependent. For instance, consider a story, which is an information artifact that inheres in some number of books. Each book bears some quality that carries the story. The relation between this quality and the generically dependent continuant is that the former is the concretization of the latter.	2012-06-26 21:14:43.163993	2012-06-26 21:14:43.163993
