78676	scalp	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000176	The scalp is an anatomical region of the head that is bordered by the face anteriorly and the neck to the sides and posteriorly. It consists of 5 layers, including (S) the outer layer, or skin, on which the hair grows, (C) connective tissue that lies just beneath the outer layer, (A) an aponeurosis called epicranial aponeurosis or galea aponeurotica, a tough layer of dense fibrous tissue which runs from the frontalis muscle anteriorly to the occipitalis posteriorly, (L) the loose areolar connective tissue layer, which constitutes an easy plane of separation between the upper three layers and the pericranium, and (P) the pericranium, or periosteum of the skull bones.	2012-06-26 21:14:45.009911	2012-06-26 21:14:45.009911
