78679	spatial_anatomical_quality	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000181	spatial_anatomical_quality is a spatial property of an entity that is located in an anatomically defined spatial region.	2012-06-26 21:14:45.016563	2012-06-26 21:14:45.016563
78680	caudality	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000182	caudality is a spatial quality that locates an object with respect to the front of the head (nasion or nose) and the back of the head (inion and occipital notch).	2012-06-26 21:14:45.018468	2012-06-26 21:14:45.018468
