78683	laterality	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0000185	laterality is quality of being located more or less close to the sides of the head (left and right ears) versus the center of the head (vertex).	2012-06-26 21:14:45.024346	2012-06-26 21:14:45.024346
