79274	Brodmann_area_7_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0076000	Brodmann_area_7_surface_region refers to a subdivision of the cytoarchitecturally defined parietal region of cerebral cortex in the guenon. It occupies most of the parietal lobe excluding the postcentral gyrus and superior parietal lobule. Brodmann-1909 considered it topologically homologous to the combined superior parietal area 7, the supramarginal area 40 (H) and the angular area 39 (H) of the human. Cytoarchitecurally he regarded it as "a still undifferentiated precursor zone for all parietal areas (apart from area 5) (Garey-1999). Distinctive features (Brodmann-1905): in area 7 compared to area 5 of Brodmann-1909, large ganglion cells are absent from the internal pyramidal layer (V); the pyramidal cells of the external pyramidal layer (III) sublayer 3b are, on average, larger; the multiform layer (VI) is denser and narrower and more sharply bounded by subcortical white matter.	2012-06-26 21:14:47.046692	2012-06-26 21:14:47.046692
79275	unnamed_ERP_diffwave_effect	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0088000	A significant_ERP_diffwave_effect is an effect that is significant over one or more regions of the scalp.	2012-06-26 21:14:47.04866	2012-06-26 21:14:47.04866
79276	Brodmann_area_44_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0094000	Brodmann_area_44_surface_region subdivision of the cytoarchitecturally defined frontal region of cerebral cortex. In the human it corresponds approximately to the opercular part of inferior frontal gyrus (H). Thus, it is bounded caudally by the inferior precentral sulcus (H) and rostrally by the anterior ascending limb of lateral sulcus (H). It surrounds the diagonal sulcus (H). In the depth of the lateral sulcus it borders on the insula. Cytoarchitectonically it is bounded caudally and dorsally by the agranular frontal area 6, dorsally by the granular frontal area 9 and rostrally by the triangular area 45 (Brodmann-1909).	2012-06-26 21:14:47.050525	2012-06-26 21:14:47.050525
79277	amplifier_stop_band	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0118000	amplifier_pass_band is a band of frequencies, between specified limits, that a circuit (e.g., an amplifier or filter) does not transmit. Frequencies above the lower limit and below the upper limit are not allowed to pass. The limiting frequencies are those at which the transmitted power level increases to a specified level, usually 3 dB below the maximum level, as the frequency is decreased or increased from that at which the transmitted power is a minimum.	2012-06-26 21:14:47.055027	2012-06-26 21:14:47.055027
79278	COP_ROI_label	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0125000	Specifies for each spatiotemporal component pair the scalp-surface region of interest containing the COP_EGI / COP_ITT electrode label location. The COP_ROI_Label is the concatenation of the scalp-surface region's position on a lateral (Left, Right, Bilateral) and anterior-posterior axis (Orbitofrontal, Frontal, Anterotemporal, Parietal, Posterotemporal, Occipital), respectively.	2012-06-26 21:14:47.056923	2012-06-26 21:14:47.056923
79279	large_adult_head_size	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0131000	...[incompete]	2012-06-26 21:14:47.05882	2012-06-26 21:14:47.05882
79280	episodically_old_condition	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0163000	An experiment condition in which the target stimulus is an object that was presented earlier in the experiment.	2012-06-26 21:14:47.063428	2012-06-26 21:14:47.063428
79281	functional_subdivision_cortical_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0170000	...[incomplete]	2012-06-26 21:14:47.065332	2012-06-26 21:14:47.065332
79282	Brodmann_area_32_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0173000	Brodmann_area_32_surface_region refers to a subdivision of the cytoarchitecturally defined cingulate region of cerebral cortex in the guenon. This area was named 25 in Brodmann-1905 and labeled 25 in a figure contributed by Brodmann in Mauss-1908. In Brodmann-1909, however, the area was labeled 32 and the name "area 25" was attached to the area that has since been the accepted area 25 of Brodmann-1909 (Vogt-87). Distinguishing features according to Brodmann-1905: in contrast with area 6 of Brodmann-1909 the cortex of area 32 is relatively thick; the transition from cortex to white matter is more gradual; the distribution of cells is less dense; and there is no distinct boundary between the inner pyramidal layer (V) and the multiform layer (VI); it is similar to area 6 in the general absence of distinct layers, particularly of an internal granular layer (IV), but differs in that cells are smaller and there is an increased density of medium sized pyramidal cells at the level of layer IV; this population of cells makes area 32 similar to the neighboring area 24 of Brodmann-1909; it differs from area 24 by its greater overall thickness and a particularly thick layer VI that merges gradually with the subcortical white matter. Brodmann-1909 regarded area 32 as topologically, but not cytoarchitecturally, homologous to the human dorsal anterior cingulate area 32; area 25 of Walker-1940 is topologically homologous to area 32.	2012-06-26 21:14:47.067188	2012-06-26 21:14:47.067188
