79478	CON_zCoord_3D	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_0595000	Specifies for each spatiotemporal component pair the z-coordinate, in arbitrary units, of its center of electrical negativity (CON) in 3-D space. It is based upon the distribution of negative electrical potential at montage-specific, scalp-surface electrode locations that are part of a reference scalp-surface region. The center of negativity (CON) is the point in 3-D space at which all negative electrical potential at the scalp-surface electrodes can be equivalently located. Computationally, it is analogous to a center of mass calculation with electrode potentials replaced by point masses. Note that CON_zCoord_3D is part of the head region, not the scalp-surface region, and does not index a scalp-surface region of interest.	2012-06-26 21:14:47.804617	2012-06-26 21:14:47.804617
