79960	lateral_COP_cluster_label	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_1460000	Specifies for each spatiotemporal component pair the degree of lateral symmetry manifest in the positive electrical potential over the measured scalp-surface. The Lateral_COP_Cluster_Label algorithm first computes the relative difference between the mean electrical potential at COP_ROI_Label and the mean electrical potential at its homologous, opposite hemisphere, scalp-surface region. The computed relative difference is then compared to LatIndex_Threshold: if LatIndex_Threshold is exceeded, Laterality_COP_Cluster is labeled as Right or Left in accordance with the hemisphere containing COP_ROI. Otherwise, Laterality_COP_Cluster is labeled as Bilateral to accord with lateral symmetry. If COP_ROI is initially part of a medial scalp-surface region, the procedure is applied to the scalp-surface regions to the right of and left of the medial COP_ROI_Label.	2012-06-26 21:14:49.569455	2012-06-26 21:14:49.569455
