80995	Brodmann_area_24_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_3091000	Brodmann_area_24_surface_region refers to a cytoarchitecturally defined cortical area that includes portions of the cingulate gyrus and the frontal lobe in the guenon. According to Walker-1940, in the macaque the molecular layer (I) is moderate in thickness; layer III is broad; layers V and VI are undifferentiated and narrow. The cells are of medium size, larger in the inner portion of layer III and outer portion of layer V, and irregularly dispersed. Walker regarded area 24 of the monkey as cytoarchitecturally homologous to the human ventral anterior cingulate area 24 and subgenual area 25.	2012-06-26 21:14:53.244851	2012-06-26 21:14:53.244851
