81011	COP_xCoord_3D	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_3116000	Specifies for each spatiotemporal component pair the x-coordinate, in arbitrary units, of its center of electrical positivity (COP) in 3-D space. It is based upon the distribution of positive electrical potential  at montage-specific, scalp-surface electrode locations that are part of a reference scalp-surface region. The center of positivity (COP) is the point in 3-D space at which all positive electrical potential at the scalp-surface electrodes can be equivalently located. Computationally, it is analogous to a center of mass calculation with electrode potentials replaced by point masses. Note that COP_xCoord_3D is part of the head region, not the scalp-surface region, and does not index a scalp-surface region of interest.	2012-06-26 21:14:53.296651	2012-06-26 21:14:53.296651
