81264	voltage_amplifier_highpass_filter_setting	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_3383000	"In an RC circuit, the value of the time constant (in seconds) is equal to the product of the circuit resistance (in ohms) and the circuit capacitance  (in farads), i.e. τ = R × C. It is the time required to charge the capacitor, through the resistor, to 63.2 (≈ 63) percent of full charge; or to discharge it to 36.8 (≈ 37) percent of its initial voltage. These values are derived from the mathematical constant e, specifically 1 − e − 1 and e − 1 respectively." (http://en.wikipedia.org/wiki/RC_time_constant)	2012-06-26 21:14:54.163841	2012-06-26 21:14:54.163841
