81792	Brodmann_area_28_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_3997000	Brodmann_area_28_surface_region refers to a subdivision of the cerebral cortex of the guenon defined on the basis of cytoarchitecture. Brodmann regarded its location adjacent to the hippocampus as imprecisely represented in the illustration of the cortex of the guenon brain in Brodmann-1909. It is located on the medial aspect of the temporal lobe. In the human it and the dorsal entorhinal area 34 (H) together constitute approximately the entorhinal area (Brodmann-1909). Distinctive features (Brodmann-1905): the molecular layer (I) is unusually wide; the external granular layer (II) contains nests of, for the most part, multipolar cells: the external pyramidal layer (III) contains medium sized pyramidal cells which merge with cells of the internal pyramidal layer (V); a clear cell free zone represents sublayer 5b of layer V; the multiform layer is wide and has a less clear two sublayer structure; the internal granular layer (IV) is totally absent.	2012-06-26 21:14:55.974985	2012-06-26 21:14:55.974985
