81889	Brodmann_area_13_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4108000	Brodmann_area_13_surface_region refers to a subdivision of the CEREBRAL CORTEX of the guenon defined on the basis of cytoarchitecture. Located in the posterior part of the INSULA, it shares with other parts of the insular cortex a wide molecular layer (I) and very wide multiform layer (VI). The external granular layer (II) is relatively dense. The external pyramidal layer (III) has a central stripe of less cellular density that separates two sublayers, IIIa and IIIb. The internal granular layer (IV) is sufficiently wide and dense to separate clearly sublayer IIIb from layer V. The boundary between layers V and VI is defined by larger ganglion cells, more pyramidal in shape, in layer V giving way to smaller, more spindle-shaped cells that become denser and more homogeneous deeper in layer VI. Often the spindle cells are arrayed horizontally as in the claustrum (VICl), which Brodmann considered a likely extension of layer VI beyond the extreme capsule (VICe) (Brodmann-1905).	2012-06-26 21:14:56.423895	2012-06-26 21:14:56.423895
