81891	elliptical_head_model	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4119000	An elliptical head model  is a computational model that describes the propagation of electrical fields through a medium with a particular set of material properties. This model represents the human head as an elliptical object composed of two (or more) nested concentric ellipses (aka "surfaces"), e.g., representing human brain, skull and scalp. Each ellipse is assigned its own thickness and conductivity value; however, these values are assumed to be homogenous and isotropic within each surface.	2012-06-26 21:14:56.430221	2012-06-26 21:14:56.430221
