81919	ERP_component_analysis_method_label	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4252000	textDefinition: Specifies the label for the algorithm(s) employed for decomposing or segmenting multichannel spatiotemporal ERP data to reveal latent ERP components. Data decomposition techniques factor the data into latent pairs of spatial and temporal factors, termed observed components, one or more of which may correspond to ERP components of interest. Data decomposition techniques are typically guided by the patterns of covariance (PCA) or statistical independence (ICA) woven through the data, by the spatial (spatial PCA/ICA) or temporal (temporal PCA/ICA) dimension from which the covariance or independence is extracted, and by the degree of component retention (unrestricted or restricted). Data segmentation techniques, such as Microstate Analysis, window the data into temporally disjoint subintervals specified by periods of stable topography, which correspond to stable cortical generator configurations, and are typically quantified by positive and negative centroid location, global map dissimilarity or global field power.	2012-06-26 21:14:56.507049	2012-06-26 21:14:56.507049
