81933	electrophysiological_data_analysis_reference	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4299000	Since an EEG voltage signal represents a difference between the voltages at two electrodes, the display of the EEG for the reading encephalographer may be set up in one of several ways. The representation of the EEG channels is referred to as a reference schema. With digital EEG, all signals are typically digitized and stored in a particular (usually referential) montage; since any montage can be constructed mathematically from any other, the EEG can be viewed by the electroencephalographer in any display montage that is desired. (http://en.wikipedia.org/wiki/Electroencephalography).	2012-06-26 21:14:56.546721	2012-06-26 21:14:56.546721
