81942	ground_electrode	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4335000	The ground electrode is linked to the "common" (zero level) of power supply to the EEG system amplifer. Note that this power supply is actually isolated from the electrode ground (by law). Indeed, the "ground" electrode is *never* linked to the electrical ground; doing so could create ground loops, which would present a safety hazard (risk of electrical shock). The term "ground" is therefore a misnomer, strictly speaking, and the term "isolated common" is sometimes used instead. Note that the EEG ground (isolated common) is distinct from the EEG reference electrode.	2012-06-26 21:14:56.571711	2012-06-26 21:14:56.571711
