82281	spherical_head_model	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_4705000	A spherical head model  is a computational model that describes the propagation of electrical fields through a medium with a particular set of material properties. This model represents the human head as a spherical object composed of two (or more) nested concentric spheres (aka "surfaces"), e.g., representing human brain, skull and scalp. Each sphere is assigned its own thickness and conductivity value; however, these values are assumed to be homogenous and isotropic within each surface.	2012-06-26 21:14:57.741517	2012-06-26 21:14:57.741517
