82543	CON_xCoord_2D	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_5451000	Specifies for each spatiotemporal component pair the x-coordinate, in arbitrary units, of its center of electrical negativity (CON) in 2-D space.  It is based upon the distribution of negative electrical potential at montage-specific, scalp-surface electrode locations that are part of a reference scalp-surface region projected onto a 2-D plane or flat map. The center of negativity (CON) is the point on the 2-D flat map at which all negative electrical potential at the scalp-surface electrodes can be equivalently located. Computationally, it is analogous to a center of mass calculation with electrode potentials replaced by point masses.	2012-06-26 21:14:58.676541	2012-06-26 21:14:58.676541
82544	acquired_dyslexia	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_5452000	Acquired dyslexia is a reading disorder that occurs following brain damage. Different patterns of brain damage are associated with different forms of acquired dyslexia. Peripheral dyslexias (neglect dyslexia, attentional dyslexia and pure alexia) that arise in the early visual perceptual processing stages affect the ability to process the visual forms of written words.  Central dyslexias (deep dyslexia, phonological dyslexia and surface dyslexia) affect the ability to understand and read aloud written words. 	2012-06-26 21:14:58.681142	2012-06-26 21:14:58.681142
