82635	Brodmann_area_14_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_5662000	Brodmann_area_14_surface_region refers to a subdivision of the CEREBRAL CORTEX of the guenon defined on the basis of cytoarchitecture. It differs most clearly from area 13 of Brodmann-1905 in that it lacks a distinct internal granular layer (IV). Other differences are a less distinct external granular layer (II), a widening of the relatively cell-free zone of the external pyramidal layer (III); cells in the internal pyramidal layer (V) are denser and rounded; and the cells of the multiform layer (VI) assume a more distinct tangential orientation (Brodmann-1905).	2012-06-26 21:14:58.963935	2012-06-26 21:14:58.963935
