82839	electrophysiological_artifact	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_5891000	Electrophysiological artifacts are anomalous (interfering signals) that originate from some source other than the electrophysiological structure being studied. These artifact signals may stem from, but are not limited to: light sources; monitoring equipment issues; utility frequency (50Hz and 60Hz); or undesired electrophysiological signals such as EMG presenting on an EEG-, EP-, ECG-, or EOG- signal. Offending artifacts may obscure, distort, or completely misrepresent the true underlying electrophysiological signal sought.	2012-06-26 21:14:59.705863	2012-06-26 21:14:59.705863
82840	Brodmann_area_33_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_5896000	Brodmann_area_33_surface_region is a subdivision of the cytoarchitecturally defined cingulate region of cerebral cortex. It is a narrow band located in the anterior cingulate gyrus adjacent to the supracallosal gyrus in the depth of the callosal sulcus. Cytoarchitecturally it is bounded by the ventral anterior cingulate area 24 and the supracallosal gyrus (Brodmann-1909).	2012-06-26 21:14:59.707739	2012-06-26 21:14:59.707739
