82926	independent_variable_specification	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_6187000	An independent_variable_specification is a plan specification that is part of a study design. Independent variables are entities whose values are selected to determine its relationship to an observed phenomenon (the dependent variable). In such an experiment, an attempt is made to find evidence that the values of the independent variable determine the values of the dependent variable (that which is being measured). The independent variable can be changed as required, and its values do not represent a problem requiring explanation in an analysis, but are taken simply as given. The dependent variable on the other hand, usually cannot be directly controlled.	2012-06-26 21:15:00.119629	2012-06-26 21:15:00.119629
