83299	Brodmann_area_16_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_6599000	Brodmann_area_16_surface_region refers to a subdivision of the CEREBRAL CORTEX of the guenon defined on the basis of cytoarchitecture. It is a relatively undifferentiated cortical area that Brodmann regarded as part of the INSULA because of the relation of its innermost multiform layer (VI) with the claustrum (VICl). The laminar organization of cortex is almost totally lacking. The molecular layer (I) is wide as in area 15 of Brodmann-1905. The space between layer I and layer VI is composed of a mixture of pyramidal cells and spindle cells with no significant number of granule cells. Pyramidal cells clump in the outer part to form glomeruli similar to those seen in some of the primary olfactory areas (Brodmann-1905).	2012-06-26 21:15:01.395333	2012-06-26 21:15:01.395333
