83311	email_address	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_6677000	An email_address is a sequence of alpha-numeric characters used as unique identifier of an email box, that is located on a particular email server, and  which is used by a person or an organization for purposes of email delivery or sending (i.e. email communication). Email address has two parts, the part before the "@" sign is the local-part of the address, often the username of the recipient, and the part after the "@" sign which is a domain name to which the e-mail message will be sent.	2012-06-26 21:15:01.428533	2012-06-26 21:15:01.428533
