83441	Brodmann_area_9_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_6731000	Brodmann_area_9_surface_region refers to a cytoarchitecturally defined portion of the frontal lobe of the guenon. Brodmann-1909 regarded it on the whole as topographically and cytoarchitecturally homologous to the granular frontal area 9 and frontopolar area 10 in the human. Distinctive features (Brodmann-1905): unlike area 6 of Brodmann-1909, area 9 has a distinct internal granular layer (IV); unlike area 6 or area 8 of Brodmann-1909 its internal pyramdal layer (V) is divisible into two sublayers, an outer layer 5a of densely distributed medium sized ganglion cells that partially merges with layer IV, and an inner, clearer, cell-poor layer 5b; the pyramidal cells of sublayer 3b of the external pyramidal layer (III) are smaller and sparser in distribution; the external granular layer (II) is narrow, with small numbers of sparsely distributed granule cells.	2012-06-26 21:15:01.971041	2012-06-26 21:15:01.971041
