83451	reference_electrode	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_6771000	The reference electrode is an electrode that is taken to be the electrical reference (or theoretical "0") for all EEG voltage measures. It therefore serves as a theoretical "0" or baseline for measuring changes in voltage at each recording site. Technically, there is no ideal reference for EEG recordings, since the reference electrode is never very far from the recording electrodes, and thus the reference is a poor approximation to "0". Thus, EEG measurements are (technically) all bipolar and should be reported as Fz-Ref, Cz-Ref, etc. So-called "reference independent" measures re-reference the EEG at each recording site to a weighted average over all the EEG electrodes. When electrodes are located over most of the head surface and at a sufficient density, the mathmatical average (or weighted average) may serve as a reasonable approximation to "0".	2012-06-26 21:15:02.00033	2012-06-26 21:15:02.00033
