84586	COP_yCoord_2D	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_8617000	Specifies for each spatiotemporal component pair the y-coordinate, in arbitrary units, of its center of electrical positivity (COP) in 2-D space.  It is based upon the distribution of positive electrical potential at montage-specific, scalp-surface electrode locations that are part of a reference scalp-surface region projected onto a 2-D plane or flat map. The center of positivity (COP) is the point on the 2-D flat map at which all positive electrical potential at the scalp-surface electrodes can be equivalently located. Computationally, it is analogous to a center of mass calculation with electrode potentials replaced by point masses.	2012-06-26 21:15:05.913254	2012-06-26 21:15:05.913254
