84588	Brodmann_area_43_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_8629000	Brodmann_area_43_surface_region is a subdivision of the cytoarchitecturally defined postcentral region of cerebral cortex. It occupies the postcentral gyrus and the precentral gyrus between the ventrolateral extreme of the central sulcus and the depth of the lateral sulcus at the insula. Its rostral and caudal borders are approximated by the anterior subcentral sulcus (H) and the posterior subcentral sulcus respectively. Cytoarchitecturally it is bounded rostrally by the agranular frontal area 6 and caudally, for the most part, by the caudal postcentral area 2 and the supramarginal area 40 (H) (Brodmann-1909).	2012-06-26 21:15:05.919604	2012-06-26 21:15:05.919604
