84602	object_recognition	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_8705000	a cognitive_process is a mental process engaging one or more systems in the intermediary or integrative processing of signals from the internal (visceral) and external (somatic) environments. It is often the result of a sensory_process (bottom-up cognition). It may be mediated by an emotion_process (motivated cognition) or by another cognitive_process, such as memory or expectancy based on prior experience (top-down cognition).	2012-06-26 21:15:05.95926	2012-06-26 21:15:05.95926
