84860	lateral_CON_cluster_label	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_9281000	Specifies for each spatiotemporal component pair the degree of lateral symmetry manifest in the negative electrical potential over the measured scalp-surface. The Lateral_CON_Cluster_Label algorithm first computes the relative difference between the mean electrical potential at CON_ROI_Label and the mean electrical potential at its homologous, opposite hemisphere, scalp-surface region. The computed relative difference is then compared to LatIndex_Threshold: if LatIndex_Threshold is exceeded, Laterality_CON_Cluster is labeled as Right or Left in accordance with the hemisphere containing CON_ROI. Otherwise, Laterality_CON_Cluster is labeled as Bilateral to accord with lateral symmetry. If CON_ROI is initially part of a medial scalp-surface region, the procedure is applied to the scalp-surface regions to the right of and left of the medial CON_ROI_Label.	2012-06-26 21:15:06.882402	2012-06-26 21:15:06.882402
