84878	Brodmann_area_5_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_9427000	Brodmann_area_5_surface_region refers to a subdivision of the parietal lobe of the guenon defined on the basis of cytoarchitecture. It occupies primarily the superior parietal lobule. Brodmann-1909 considered it topologically and cytoarchitecturally homologous to the preparietal area 5 of the human. Distinctive features (Brodmann-1905): compared to area 4 of Brodmann-1909 area 5 has a thick self-contained internal granular layer (IV); lacks a distinct internal pyramidal layer (V); has a marked sublayer 3b of pyramidal cells in the external pyramidal layer (III); has a distinct boundary between the internal pyramidal layer (V) and the multiform layer (VI); and has ganglion cells in layer V beneath its boundary with layer IV that are separated from layer VI by a wide clear zone.	2012-06-26 21:15:06.932344	2012-06-26 21:15:06.932344
