85011	Brodmann_area_10_surface_region	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_9551000	Brodmann_area_10_surface_region refers to a subdivision of the frontal lobe of the guenon defined on the basis of cytoarchitecture. Brodmann-1909 did not regard it as cytoarchitecturally homologous to his human frontopolar area 10. Distinctive features (Brodmann-1905): compared to area 9 of Brodmann-1909, the multiform layer (VI) of area 10 shows an unusual organization of cells into trains oriented parallel to the cortical surface that are separated from one another by narrow cell-free fiber bundles; less marked differences are an overall thinner cortical thickness and a somewhat thicker molecular layer (I). Compared to area 6 of Brodmann-1909, area 10 has a subtle but clearly present internal granular layer (IV); layer 3b of the of the external pyramidal layer (III) is weakly developed and composed of medium sized pyramidal cells; and the internal pyramidal layer (V) is more developed.	2012-06-26 21:15:07.470936	2012-06-26 21:15:07.470936
