85025	infinite_impulse_response_filter_algorithm	http://purl.bioontology.org/NEMO/ontology/NEMO.owl#NEMO_9634000	"Infinite impulse response (IIR) is a property of signal processing systems. Systems with this property are known as IIR systems or, when dealing with filter systems, as IIR filters. IIR systems have an impulse response function that is non-zero over an infinite length of time. This is in contrast to finite impulse response filters (FIR), which have fixed-duration impulse responses. The simplest analog IIR filter is an RC filter made up of a single resistor  (R) feeding into a node shared with a single capacitor  (C). This filter has an exponential impulse response characterized by an RC time constant." (http://en.wikipedia.org/wiki/Infinite_impulse_response).	2012-06-26 21:15:07.514477	2012-06-26 21:15:07.514477
